import React from 'react';
import classes from './dialogs.module.css';
import {NavLink} from "react-router-dom";

let dialogs = [
  { id: 1, name: "Natalya" },
  { id: 2, name: "Rudick" },
  { id: 3, name: "Denis" },
  { id: 4, name: "David" },
  { id: 5, name: "Rojer" },
  { id: 6, name: "Max" }
];

let dialogsElements = dialogs
.map( d => <DialogsItem id={d.id} name={d.name} /> );

let messagesElements = messages.map( m => 
  <Message message={m.message} />);

let messages = [
  {id:1, message:'Yo!'},
  {id:2, message:'Hello my friend'},
  {id:3, message:'How are you?'},
  {id:4, message:'I am Ok'}
];

const DialogsItem = (props) => {
    let path = "/dialogs/" + props.id; 
    return (
      <div className={classes.dialog}>
        <NavLink to={path}>{props.name}</NavLink>
      </div>
    );
}

const Message = (props) => {
    return (
        <div className={classes.message}>
            {props.message}
        </div>
    )
}

const Dialogs = (props) => {
    return (
      <div className={classes.wrapper}>
        <div className={classes.dialogsItems}>
          <DialogsItem id={dialogs[0].id} name={dialogs[0].name} />
          <DialogsItem id={dialogs[1].id} name={dialogs[1].name} />
          <DialogsItem id={dialogs[2].id} name={dialogs[2].name} />
          <DialogsItem id={dialogs[3].id} name={dialogs[3].name} />
          <DialogsItem id={dialogs[4].id} name={dialogs[4].name} />
          <DialogsItem id={dialogs[5].id} nama={dialogs[5].name} />
        </div>
        <div className={classes.messages}>
          <Message message={messages[0].message} />
          <Message message={messages[1].message} />
          <Message message={messages[2].message} />
          <Message message={messages[3].message} />
        </div>
      </div>
    );
}
export default Dialogs;
